import React from 'react';
import './App.css';
import HomePage from './components/HomePage';
import DetailPage from './components/DetailPage';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
function App() {

  return (
    <Router>
      <Switch>
        <Route exact path="/" ><HomePage /></Route>
        <Route path="/home" ><HomePage /></Route>
        <Route path="/detail"><DetailPage title="Burger Chiken" price="$2.35 – $5.55" image= "1"/></Route>
        <Route path="/detail2"><DetailPage title="Le burger au bacon" image= "2" /></Route>
        <Route path="/detail3"><DetailPage title="" image= "3" /></Route>
        <Route path="/detail4"><DetailPage title="" image= "4" /></Route>
        <Route path="/detail5"><DetailPage title="Burger vegan : le hamburger le plus végétal" image= "5" /></Route>
        <Route path="/detail6"><DetailPage title="Le burger le plus végétarien" image= "6" /></Route>
      </Switch>
    </Router>

  )
}

export default App;
